  wire filter_in_data_log_rdenb; // boolean
  reg  [11:0] filter_in_data_log_addr; // ufix12
  reg  filter_in_data_log_done; // boolean
  wire   signed [15:0] rawData_filter_in; // sfix16
  reg  signed [15:0] holdData_filter_in; // sfix16
